/**
 * Alphabetizes array by value
 *
 * @param {Array} array the array to sort
 * @return {Array} the sorted array
 */
export function alphabetizearray(array) {
  return array.sort((a, b) => {
    return a.localeCompare(b);
  });
}

/**
 * Looks for ancestor elemnt with given selector
 *
 * @param {HTMLElement} elem the elemnt to test
 * @param {String} selector the selector you're looking for
 * @return {HTMLElement} element The closest element
 */
export function closest(elem, selector) {
  let element = elem;
  let matchesSelector = element.matches || element.webkitMatchesSelector || element.mozMatchesSelector || element.msMatchesSelector;
  while (element) {
    if (matchesSelector.call(element, selector)) {
      break;
    }
    element = element.parentElement;
  }
  return element;
}

const monthNames = ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'October', 'November', 'December'];

/**
 * Convert date to human readable
 *
 * @param {String} ISO an ISO date string
 * @return {String} human readable date
 */
export function convertdate(ISO) {
  let thisDate = new Date(ISO);
  let year = thisDate.getFullYear();
  let month = monthNames[thisDate.getMonth()];
  let day = thisDate.getDate();

  return `${month } ${ day }, ${ year}`;
}

/**
 * Given a cookie name, returns value of that cookie
 *
 * @param {String} name the name of the cookie
 * @return {String} the value of the cookie
 */
export function getcookie(name) {
    const cookiestring = `${name}=`;
    const decodedCookie = decodeURIComponent(document.cookie);
    const cookies = decodedCookie.split(';');
    for (let i = 0; i < cookies.length; i++) {
        let cookie = cookies[i];
        while (cookie.charAt(0) == ' ') {
            cookie = cookie.substring(1);
        }
        if (cookie.indexOf(cookiestring) == 0) {
            return cookie.substring(cookiestring.length, cookie.length);
        }
    }
    return '';
}

/**
 * Create and set a cookie
 *
 * @param {String} name the name of the cookie
 * @param {String} value the value of the cookie
 * @param {Number} expire the number of days after which the cookie will expire
 */
export function setcookie(name, value, expire) {
    const date = new Date();
    date.setTime(date.getTime() + (expire*24*60*60*1000));
    const expires = 'expires=' + date.toUTCString();
    document.cookie = `${name}=${value};${expires};path=/`;
}

/**
 * Returns a function, that, as long as it continues to be invoked, will not
 * be triggered. The function will be called after it stops being called for
 * N milliseconds. If `immediate` is passed, trigger the function on the
 * leading edge, instead of the trailing.
 *
 * @param  {Function} func A function to call after N milliseconds
 * @param  {number} wait The number of milliseconds to wait
 * @param  {boolean} immediate Trigger the function on the leading edge instead of the trailing
 * @return {Function} A function, that, as long as it continues to be invoked, will not be triggered
 */
export function debounce(func, wait, immediate) {
  let timeout;
  return function () {
    let context = this;
    let args = arguments;
    let later = function () {
      timeout = null;
      if (!immediate) func.apply(context, args);
    };
    let callNow = immediate && !timeout;
    clearTimeout(timeout);
    timeout = setTimeout(later, wait);
    if (callNow) func.apply(context, args);
  };
}

/**
 * Parse to HTML
 *
 * @param {String} data data to parse into HTML
 * @return {HTMLElement} HTML
 */
export function decodehtml(data) {
    const parser = new DOMParser;
    const dom = parser.parseFromString(
        '<!doctype html><body>' + data,
        'text/html');
    return dom.body.textContent;
}

/**
 * Returns a random number
 *
 * @param {Number} max the highest number the random number can be
 * @return {Number} the rnadom number
 */
export function generaterandominteger(max) {
  return Math.floor(Math.random() * Math.floor(max));
}

/**
 * Returns user's first langauge preference in the browser
 *
 * @param {Boolean} uniform - true if a given langauge isn't localized per country (e.g. en-US va en-GB), false if it is
 */
export function getuserlangauge(uniform = true) {
  const lang = navigator.languages ? navigator.languages[0] : navigator.language || navigator.userLanguage;
  return uniform ? lang.substring(0, 2) : lang;
}

/**
 * Returns YouTube ID from a YouTube URL
 *
 * @param {String} url a URL with a YouTube ID in it
 */
export function getyoutubeidfromurl(url) {
  let ID = '';
  url = url.replace(/(>|<)/gi, '').split(/(vi\/|v=|\/v\/|youtu\.be\/|\/embed\/)/);

  if (url[2] !== undefined) {
    ID = url[2].split(/[^0-9a-z_\-]/i);
    ID = ID[0];
  }
  else {
    ID = url;
  }

  return ID;
}

/**
 * Returns a Boolean corrsponding to whether or not the device/browser
 * in use is capable of hover events
 *
 * @return {Boolean} true if device is hover event-capable; false if not
 */
export function hashover() {
  let hoverQuery = window.matchMedia('(hover: hover)');
  let anyQuery = window.matchMedia('(any-hover: none), (any-pointer: coarse)');
  return !!((hoverQuery.matches || !anyQuery.matches));
}

/**
 * Convert HEX color to RGB
 *
 * @param {String} hex a hex color
 * @return {String} A CSS rgb color value
 */
export function hextorgb(hex) {
    const rgb = hex.replace(/^#?([a-f\d])([a-f\d])([a-f\d])$/i
        , (m, r, g, b) => '#' + r + r + g + g + b + b)
        .substring(1).match(/.{2}/g)
        .map((x) => parseInt(x, 16));

    return `rgb(${rgb[0]},${rgb[1]},${rgb[2]})`;
}

