/**
 * A SocialShare module which handles Facebook and Twitter social share buttons
 *
 * @class SocialShare
 */
export class SocialShare {
  constructor() {
    /**
         * OGINFO
         *
         * An object containing OG tag data pulled from og tags
         *
         * @type {Object}
         * @ignore
         */
    this.OGINFO = {
      DESC: null,
      URL: null,
      TITLE: null,
    };

    this.OGSTRINGS = {
      OGDESC: 'meta[property="og:description"]',
      OGTITLE: 'meta[property="og:title"]',
      OGURL: 'meta[property="og:url"]',
    }
  }

  /**
     * Get OG data from page's OG tags
     * Set defaults if no tags available
     *
     * @return {Object} SocialShare A reference to the instance of the class
     * @chainable
     */
  getOGData() {
    // First, see if we get the URL from a FB OG tag
    Object.keys(this.OGINFO).forEach((key) => {
      let node = document.querySelector(this.OGSTRINGS[`OG${ key}`]);

      if (node) {
        this.OGINFO[key] = node.getAttribute('content');
      }
    });

    // if not, is there a canoical URL?
    if (!this.OGINFO.URL) {
      // set to the URL in the location bar, just in case
      let canonical = window.location;
      let links = document.getElementsByTagName('link');

      for (let i = 0; i < links.length; i++) {
        if (links[i].getAttribute('rel') === 'canonical') {
          canonical = links[i].getAttribute('href');
        }
      }

      this.OGINFO.URL = canonical;
    }

    return this;
  }

  /**
     * Facebook share
     *
     */
  facebookShare() {
    this.getOGData();
    const shareURL = '//www.facebook.com/sharer.php?u=' + this.OGINFO.URL;
    openpopup(shareURL, 'FacebookShare', 420, 300);
  }

  /**
     * Twitter share
     *
     */
  twitterShare() {
    this.getOGData();
    const shareURL = '//twitter.com/share?url=' + this.OGINFO.URL;
    openpopup(shareURL, 'TwitterShare', 320, 300);
  }
}

/**
 * Converts spaces in a string to a hyphen
 *
 * @param {String} string the string with spaces in need of conversion
 *
 * @return {Boolean} the converted string
 */
export function spacetohyphen(string) {
  return string.replace(/\s+/g, '-');
}

/**
 * Given an HTML string, eturns a string of plain text
 *
 * @param  {Object} html - string of html to strip
 * @return {String} A plain text string
 */
export function striphtml(html) {
  const parsed = new DOMParser().parseFromString(html, 'text/html');

  return parsed.body.textContent || '';
}

/**
 * Truncates text to desired character length, optinally includes ellipsis and trunactes to wro boundary
 *
 * @param {String} string the string in need of truncating
 * @param {Number} maxLength the length of the desired text string
 * @param {Boolean} useWordBoundary should anything be appeneded to the end? Defaults to true
 * @param {String} ellipsis the string to append, if so; defaults to '...'
 *
 * @return {Boolean} the truncated string
 */
export function truncatetext(string, maxLength, useWordBoundary = true, ellipsis = '...') {
  if (str.length > maxLength) {
    const substring = str.slice(0, maxLength - ellipsis.length);
    return useWordBoundary ? substring.substr(0, substring.lastIndexOf(' ')) + ellipsis : substring + ellipsis;
  }
  return str;
}

/**
 * Returns a URL encoded string for use in submission to Tools API
 *
 * @param  {Object} requestdata JSON to return as URL Encoded string
 * @return {String} A URLEncoded string
 */
export function urlencoder(requestdata) {
  const encoded = Object.keys(requestdata).map((key) => {
    return `${encodeURIComponent(key) }=${ encodeURIComponent(requestdata[key])}`;
  }).join('&');

  return encoded;
}

/**
 * A class which handles field validations
 */
export class Validation {
  /**
     * validate
     *
     * A function which processes validations
     * NOTE: this could be expanded and reused
     *
     * @param {String=} fieldvalue tthe value of the field to be validated
     * @param {String=} fieldtype type of field to be validated
     * @param {Object=} rules validation rules
     * @param {String=} type are we matching or testing? Default = match
     */
  validate(fieldvalue, fieldtype, rules, type = MISC.MATCH) {
    return type === 'match' ? fieldvalue.match(rules[fieldtype].rule) : rules[fieldtype].rule.test(fieldvalue);
  }
}
